import { createRouter, createWebHistory } from "vue-router";

const routes = [
  {
    path: "/",
    name: "users",
    component: () => import("../views/UserView.vue"),
  },
  {
    path: "/",
    name: "caregiver",
    component: () => import("../views/UserView.vue"),
  },

  {
    path: "/",
    name: "pets",
    component: () => import("../views/UserView.vue"),
  },
  {
    path: "/",
    name: "sale",
    component: () => import("../views/UserView.vue"),
  },
  {
    path: "/",
    name: "typeservice",
    component: () => import("../views/UserView.vue"),
  },
  {
    path: "/",
    name: "sercice",
    component: () => import("../views/UserView.vue"),
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
